BEFORE DELETE ON `asdf_db`.`services`
FOR EACH ROW
BEGIN
	DELETE FROM have_access
	WHERE have_access.place_id IN
		(SELECT p.place_id
         FROM places p
         WHERE p.offered_service_id = OLD.service_id);
             
	UPDATE places
    SET
